import React, { useState } from 'react';
import axios from 'axios';
import NavBar from './NavBar';
import './css/mypage.css';

export default function Mypage() {
    const [error, setError] = useState('');

    const handleLogin = async (e) => {
        e.preventDefault();
      
        try {
            const response = await axios.post(
                'http://localhost:8080/users/myPage',
                {
                },
                {
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    withCredentials: true
                }
            );
        
            if (response.status === 200) {
                console.log(response.data);
            }
        } catch (err) {
            setError('정보를 불러오는데 실패 했습니다.');
            console.error(err);
        }
    };

    return (
        <>
        <NavBar />

        <div className="mypage-wrapper">
            <div className="mypage-box">
            <h2 className="mypage-title">마이페이지</h2>

            <div className="info-section">
                <p><strong>이름:</strong> {user_name}</p>
                <p><strong>이메일:</strong> {email}</p>
                <p><strong>아이디:</strong> {user_id}</p>
                <p><strong>회원등급:</strong> {membership_lvl}</p>
                <p><strong>성별:</strong> {gender}</p>
                <p><strong>키:</strong> {height}</p>
                <p><strong>몸무게:</strong> {user_weight}</p>
                <p><strong>주소:</strong> {user_address}</p>
                <p><strong>가입일시:</strong> {reg_date}</p>
                <p><strong>수정일시:</strong> {upd_date}</p>
            </div>

            <button className="mypage-button">비밀번호 변경</button>
            <button className="mypage-button secondary">로그아웃</button>
            </div>
        </div>
        </>
    );
}
